window.bookSummaryJSON = "<p><b><i>New York Times</i> best-selling author Eric Flint continues his Ring of Fire series with esteemed sci-fi author Charles E. Gannon. </b></p> <p>Rome in the year 1635 finds Frank Stone and his pregnant wife Giovanna in the clutches of Cardinal Borgia, whose political machinations and papal assassins may soon elevate him to Pope Borgia. Now Frank, along with Harry Lefferts and his infamous Wrecking Crew, must protect Pope Urban VII from all manner of treachery.</p>"; 
